import React from "react";
const getDateString = (date) => {
  if (date === undefined) {
    date = new Date();
  }

  const yy = date.getFullYear();
  const mm = date.getMonth() + 1;
  const dd = date.getDate();

  const str = `${yy} ${mm < 10 ? "0" + mm : mm} ${dd}`;
  return str;
};
const DateRange1 = () => {
  return (
    <div>
      <h2>DateRange1</h2>
    </div>
  );
};

export default DateRange1;
